double eval_t(double x, int df) {
    int i;

    x = abs(x);
    df--;

    if(df>199) df = 199;
    if(df<1) return(1);

    if(x<=TD[df][0]) return(0.5 + (TT[0]-0.5)*x/TD[df][0]);
    for(i=0;i<9;i++) {
        if(TD[df][i]< x && x<=TD[df][i+1]) {
            return(TT[i] + (TT[i+1]-TT[i])*(x-TD[df][i])/(TD[df][i+1]-TD[df][i]));
        }
    }
    return(TT[i] + (0 - TT[i])*(x-TD[df][i])/(INFTY - TD[df][i]));
}



